    public static long solver(int idx, int lastColour, int kLeft, int[] build, long[][] matrix, int K, 
    		Long[][][] dp, int nCount, int nColor) {
		if(idx == nCount) {
			if(kLeft == 0) {
				return 0;
			}
			return Long.MAX_VALUE;
		}
		if (dp[idx][lastColour][kLeft] != null) {
	//	System.out.println("Found for : " + idx + " : " + lastColour +" : " + now_k);
			return dp[idx][lastColour][kLeft];
		}
		// Recursive Work
		long min = Long.MAX_VALUE;
		if(build[idx] != 0) {
			if(lastColour == build[idx]) {
				min = solver(idx + 1, build[idx], kLeft, build, matrix, K, dp, nCount, nColor);
			} else {
				if (!(kLeft - 1 < 0))
					min = solver(idx + 1, build[idx], kLeft - 1, build, matrix, K, dp, nCount, nColor);
			}
		} else {
		
			for (int i = 1; i < matrix[idx].length; i++) {
				//selecting all colors for painting
				long ret;
				int curColor = i;
				if(lastColour == curColor) {
					ret = solver(idx+1, curColor, kLeft, build, matrix, K, dp, nCount, nColor);
					if(ret == Long.MAX_VALUE) {
						min = Math.min(min, Long.MAX_VALUE);
					}
					else {
						min = Math.min(min,matrix[idx][curColor] + ret);
					}
				}
				else {
					if (kLeft - 1 < 0)
						continue;
					ret = solver(idx+1, curColor, kLeft - 1, build, matrix, K, dp, nCount, nColor);
					if(ret == Long.MAX_VALUE) {
						min = Math.min(min, Long.MAX_VALUE);
					}
					else {
						min = Math.min(min, matrix[idx][curColor] + ret);
					}
				}
			}
		}
		dp[idx][lastColour][kLeft] = min;
		return min;
	}
	    public static void main (String[] args) throws Exception {
	        
	    	solve();
	    }
	

